                    {/*      values,*/}
                    {/*      errors,*/}
                    {/*      isValid,*/}
                    {/*      isSubmitting*/}
                    {/*  }) => (*/}
                        <Form noValidate>
                            <Col>
                                <FormTextField
                                    as={Col}
                                    md="4"
                                    controlId="validationFormikUsername"
                                    label="Username"
                                    type="text"
                                    name="username"
                                    inputGroupPrepend={
                                        <InputGroup.Prepend>
                                            <InputGroup.Text id="inputGroupPrepend">@</InputGroup.Text>
                                        </InputGroup.Prepend>
                                    }
                                />
                            </Col>
                            <Col>
                                <Button
                                    variant="success"
                                    as="input"
                                    size="lg"
                                    type="submit"
                                    value="Submit"
                                />
                            </Col>
                        </Form>
                    {/*)}*/}
                </Formik>
            </Col>
        </Row>
    );
}

export default Login;
